class Solution(object):
    def distributeCandies(self, n, limit):
        """
        :type n: int
        :type limit: int
        :rtype: int
        """
        dp = [[0] * (limit + 1) for _ in range(4)]
        dp[0][0] = 1
        for i in range(1, 4):
            for j in range(n + 1):
                for k in range(limit + 1):
                    if j >= k:
                        dp[i][j] += dp[i - 1][j - k]
        return dp[3][n]
